ERROR - 2023-12-28 02:34:26 --> Query error: Unknown column 'tulisan_admin_id' in 'field list' - Invalid query: update tbl_tulisan set tulisan_judul='SDN Pelaihari 9 menjadi salah satu Green School terbaik',tulisan_isi='<p>*Pelaihari, 17 Desember 2023* &mdash; SDN Pelaihari 9 berhasil meraih penghargaan sebagai Sekolah Hijau Terbaik di Kota ini, menandai prestasi gemilang dalam upaya pelestarian lingkungan dan pengelolaan sumber daya alam yang berkelanjutan.</p>

<p>Penghargaan ini diberikan oleh Dinas Pendidikan dan Lingkungan Hidup setempat dalam sebuah acara penghargaan yang diselenggarakan di Gedung Pemkab Tanah Laut&nbsp;kemarin malam. SDN Pelaihari 9 berhasil mengungguli pesaing-pesaingnya dengan inovasi dan komitmen tinggi dalam menjalankan program-program lingkungan.</p>

<p>Kepala Sekolah SDN Pelaihari 9, Bapak taufik, menyatakan rasa bangganya atas pencapaian ini. &quot;Kami sangat bersyukur dan bangga mendapatkan penghargaan ini. Ini adalah hasil dari kerja keras dan kolaborasi seluruh warga sekolah, termasuk siswa, guru, dan orangtua murid. Kami selalu mengajarkan nilai-nilai keberlanjutan dan menciptakan kesadaran lingkungan sejak dini kepada siswa kami,&quot; ujar Bapak Taufik.</p>

<p>Salah satu program unggulan yang membawa SDN Pelaihari 9 meraih penghargaan ini adalah penanaman pohon di sekitar area sekolah. Dengan melibatkan siswa dan guru, mereka berhasil menanam lebih dari 500 pohon dalam setahun. Selain itu, sekolah ini juga memiliki program daur ulang yang efektif, mengurangi sampah plastik dan kertas secara signifikan.</p>

<p>&quot;Kami tidak hanya fokus pada penghijauan sekolah, tetapi juga berusaha menciptakan budaya peduli lingkungan di kalangan siswa. Mereka belajar bahwa keberlanjutan adalah tanggung jawab bersama untuk masa depan yang lebih baik,&quot; tambah Bapak Taufik.</p>

<p>Penghargaan ini menjadi motivasi bagi SDN Pelaihari 9 untuk terus meningkatkan program-program lingkungan dan memberikan dampak positif bagi masyarakat. Sekolah ini berharap dapat menjadi inspirasi bagi sekolah lainnya untuk mengadopsi praktik-praktik ramah lingkungan guna mendukung keberlanjutan planet kita.</p>

<p>Dengan prestasi ini, SDN Pelaihari 9 membuktikan bahwa upaya kecil dari sebuah sekolah dapat memberikan kontribusi besar dalam menjaga keberlanjutan lingkungan dan menciptakan generasi yang peduli terhadap alam.</p>
